import * as React from 'react';
import { SVGProps } from 'react';

const IconUnsortSizeXs = (props: SVGProps<SVGSVGElement>) => (
  <svg viewBox="0 0 12 12" xmlns="http://www.w3.org/2000/svg" {...props}>
    <path d="M11 3v1H1V3h10zM8 9v1H1V9h7zM5 7V6H1v1h4z" />
  </svg>
);
export default IconUnsortSizeXs;
